import React from "react";

const ImageLinkForm = () => {
    return (
		<div className="ba flex justify-center flex-column">
			<div>
				<p>The Magic Brain will detect faces in your pictures. Give it a try!</p>
			</div>
			<div className="test outline pa3 ma3 mt0 w-50">
				<input className="w-30 pa1" type='text' />
				<button className="w-10 pa1">Detect</button>
			</div>
		</div>

    );
}

export default ImageLinkForm;
